import React from "react";
import "../styles/promotions.css";

const GymBenefitsBar = () => {
  return (
    <section className="gym-benefits-bar">
      <div className="benefit-bar">
        <div className="disc"></div>
        <div className="bar-text">Nueva línea Oversize</div>
        <div className="disc"></div>
      </div>

      <div className="benefit-bar">
        <div className="disc"></div>
        <div className="bar-text">Envío gratis por compras superiores a $150.000</div>
        <div className="disc"></div>
      </div>

      <div className="benefit-bar">
        <div className="disc"></div>
        <div className="bar-text">10% OFF en colección Noir</div>
        <div className="disc"></div>
      </div>
    </section>
  );
};

export default GymBenefitsBar;
